import { Grid } from "@mui/material";
import React from "react";
import ProductList from "../components/ProductList";
import SideMenu from "../components/SideMenu";

function Home() {
  return (
    <Grid container>
      <Grid
        item
        md={3}
        sx={{
          mt: 7,
          ml: 6,
          display: { xs: "none", md: "block" },
        }}
        position="fixed"
      >
        <SideMenu />
      </Grid>
      <Grid item md={8} xs={12} sm={12}>
        <ProductList />
      </Grid>
    </Grid>
  );
}

export default Home;
